import React from "react";
import '../scss/components/Developer.scss';
const TRANSPARENT_IMAGE = `image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVR42mNk+P+/HgAFhAJ/wlseKgAAAABJRU5ErkJggg==`;
export default function Developer(props) {
    const {alt = '', img = TRANSPARENT_IMAGE, firstName = 'John', lastName = 'Doe'} = props;
    let name = `${firstName} ${lastName}`;
    return <div className="developer">
        <img src={img} alt={alt} />
        <span className="name">{name}</span>
    </div>
}
